import React, { useState } from 'react';

export default function PageAccueil() {
  const [first, setfirst] = useState(0);
  const myInterval = setInterval(() => {
      setfirst(first+=1);
  }, 1000);
  return (
    <div>
        {first};
    </div>
  )
}
